/*Scripts avulsos*/
/*Password*/
$('#create_show_password').click(function() {
	if ($('#create_show_password').prop('checked')) {
		$('#create_password').attr('type','text');
	}
	else {
		$('#create_password').attr('type','password');
	}
});

/*Tooltip*/
$(document).ready(function() {
	$('[data-toggle="tooltip"]').tooltip();
});

/*Alerts*/
if (document.getElementById("alertCodRegister").value == 1 || document.getElementById("alertCodRegister").value == 2) {
	bootbox.alert(document.getElementById("alertMsgRegister").value);
}

if (document.getElementById("alertError").value != null && document.getElementById("alertError").value != "") {
	bootbox.alert("O login ou senha informado  invlido. Tente novamente.");
}

if (document.getElementById("alertMessage").value == 'success') {
	bootbox.alert(document.getElementById("alertMsgEmailSent").value);
}

if (document.getElementById("alertMessage").value == 'error') {
	bootbox.alert(document.getElementById("alertMessageContent").value);
}

/*Captcha*/
function debounce(func,wait,immediate){
	var timeout;
	return function(){
		var context=this,args=arguments;
		var later=function(){
			timeout=null;
			if (!immediate) func.apply(context,args);
		};
		var callNow=immediate && !timeout;
		clearTimeout(timeout);
		timeout=setTimeout(later,wait);
		if(callNow) func.apply(context,args);
	};
};
function recaptchaCallback(){
	var response=grecaptcha.getResponse(),
	$button=jQuery(".button-register");
	jQuery("#hidden-grecaptcha").val(response);
	console.log(jQuery("#formContact").valid());
	if(jQuery("#formContact").valid()){$button.attr("disabled",false);}
	else{$button.attr("disabled","disabled");}
}
function recaptchaExpired(){
	var $button=jQuery(".button-register");
	jQuery("#hidden-grecaptcha").val("");
	var $button=jQuery(".button-register");
	if(jQuery("#formContact").valid()){$button.attr("disabled",false);}
	else{$button.attr("disabled","disabled");}
}
function submitFormContact(){jQuery("#formContact").submit();}
(function($,root,undefined){
	$(function(){
		'use strict';
        jQuery("#formContact").find("input").on("keyup",debounce(function(){
        	var $button=jQuery(".button-register");
          	console.log(jQuery("#formContact").valid());
          	if(jQuery("#formContact").valid()){$button.attr("disabled",false);}
          	else{$button.attr("disabled","disabled");}
        },1000));
        jQuery("#formContact").validate({
        	rules:{
            	"email":{required:true,email:true},
            	"message":{required:true,minlength:"10"},                
            	"hidden-grecaptcha":{required:true,minlength:"255"}
          	},
          	messages:{
        		"email":"Por favor, informe um email.",
            	"message":{
            		required:"Por favor, preencha o campo de mensagem.",
					minlength:"A mensagem deve conter pelo menos 10 caracteres."
            	},
            	"hidden-grecaptcha":"Por favor, marque o campo No sou um rob."
          	},
          	submitHandler: submitFormContact
        });
    });
})(jQuery, this);